import React from 'react';
import Link from 'next/link'
import { Button } from 'antd'

const Cook = () => {
    return (
    <>
        <div>요리 레시피 </div>
        <Link href="/"><Button>홈</Button></Link>
        <Link href="/profile"><Button>프로필</Button></Link>
    </>)
}

export default Cook;
